import "../App.css"

import {useNavigate} from "react-router-dom";
import {Row, Column, Container, Button, Nav, Navbar} from "react-bootstrap"

import AppNavbar from "../components/Navbars"
import AppFooter from "../components/Footer"


var cleanser_products = [
    {id:1, skin_concern: "Acne", name: "Salicylic Acid Cleanser", description: "Treats acne-prone skin", price: "₹299"},
    {id:2, skin_concern: "Blackheads", name: "Clay Cleanser", description: "Dissolves oil and debris inside pores", price: "₹299"},
    {id:3, skin_concern: "Dark Spots", name: "Vitamin C Cleanser", description: "Treats acne-prone skin (oily/combination)", price: "₹299"},
    {id:4, skin_concern: "Pores", name: "Niacinamide Cleanser", description: "Treats acne-prone skin (oily/combination)", price: "₹299"},
    {id:5, skin_concern: "Wrinkles", name: "Retinol cleanser", description: "Treats acne-prone skin (oily/combination)", price: "₹299"}
]

export default function ShopPage(){

    const navigate= useNavigate();

    return(
        <>
        <main>
            {/* ------- Navbar Section -------- */}
				<AppNavbar />

            {/* -------- Shop Navbar --------- */}

                <Container>
                    <Navbar>
                        <Nav.Link>Cleanser</Nav.Link>
                        <Nav.Link>Serum</Nav.Link>
                        <Nav.Link>Moisturiser</Nav.Link>
                        <Nav.Link>Sunscreen</Nav.Link>
                    </Navbar>

                    <Row>

                    </Row>
                </Container>

            {/* ----------- Footer -----------*/}  
                <AppFooter />
        </main>
        </>
    )
}
